import { useState } from 'react';
import React from 'react';
import './App.css';
import { v4 as uuid } from 'uuid'

import Header from './components/Header/Header';
import AddTodoInput from './components/AddTodoInput/AddTodoInput';
import TodoCard from './components/TodoCard/TodoCard';

export default function App() {
  const [todos, setTodos] = useState(initialTodos);
  // console.log('uuid생성 : ',uuid());

  return (
    <div className='container'>
      {/* 제목 */}
      <Header>Todo List</Header>
      {/* todo 생성칸 */}
      <div className='add-todo-container'>
        <AddTodoInput title="제목" placeholder="제목을 입력하세요"></AddTodoInput>
        <AddTodoInput title="내용" placeholder="내용을 입력하세요"></AddTodoInput>
      </div>
      {/* todo card */}
      <div className='todo-list-container'> 
        <TodoCard title="Acitve" />
        <TodoCard title="Done" />
      </div>
    </div>
  )
}

// todo 초기값
const initialTodos = [
  {
    id : uuid(),
  }
]
